    false,nt"url": null,nt"notes": "This annual narrative report for Kirwin
    NWR outlines Refuge accomplishments during the 1985 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses management planning. Refuge administration is
    outlined; information about personnel, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands, forests, croplands, grasslands, haying,
    fire management, pest control, and wilderness areas. The wildlife section of the
    report discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, fisheries resources, and marking and bird banding.
    The public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about major
    maintenance, equipment replacement, and energy conservation. Cooperative programs
    and items of interest are provided at the end. Refuge brochures and field guides
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
